  [],\n\t\"revision_timestamp\": \"2015-09-26T21:23:35.982017\",\n\t\"name\": \"north-pacific-high-1967-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Variations in large-scale atmospheric forcing
  influence upwelling dynamics and ecosystem productivity in the California Current
  System (CCS). In this paper, we characterize interannual variability of the North
  Pacific High over 40 years and investigate how variation in its amplitude and position
  affect upwelling and biology. We develop a winter upwelling \"pre-conditioning\"
  index and demonstrate its utility to understanding biological processes. Variation
  in the winter NPH can be well described by its areal extent and maximum pressure,
  which in turn is predictive of winter upwelling. Our winter pre-conditioning index
  explained 64% of the variation in biological responses (fish and seabirds). Understanding
  characteristics of the NPH in winter is therefore critical to predicting biological
  responses in the CCS.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
